import React, { Component } from 'react';
import Mutation from 'react-apollo';



class CreateRestaurant extends Component {
  render() {
    return (
      <form>
        <fieldset>
          <label htmlFor="name">
            Restaurant Name
            <input type="text" id="name" name="name" required />
          </label>
        </fieldset>
      </form>
    )
  }
}

export default CreateRestaurant;
